================================================================================================================================

--Q1 ## What was total quentity sold for all the products?

select p.product_name, sum(s.qty) as sale_counts
from sales s
join product_details p
on s.prod_id = p.product_id
group by p.product_name
order by sale_counts desc;

------------
--Q2 ## What is the total generated revenue for all the products before discount?

select sum(price * qty) as total_revenue
from sales

---------------------------------
--Q3.  What was the total discount amount for all the products ?

select sum(price * qty * discount)/100 as total_discount
from sales

----------------------------------
--Q4. How many unique transactins were there?

select count(distinct txn_id) as unique_tranc
from sales;

-----------------------------------------------
--Q5. What are the average unique products purchased in each transaction?

with cte as(
select txn_id, count(distinct prod_id) as prod_count
from sales 
group by txn_id
)
select avg(prod_count) as avg_unique_prod
from cte

--------------------------------------------
--Q6. What is the average discount value per transaction?

with cte as(
select txn_id, sum(qty * price * discount) as total_discount
from sales 
group by txn_id
)
select round(avg(total_discount),2) as avg_prod
from cte

-------------------------------------------
--Q7. What is the average revenue for member transactions and non-member transactions?

with cte as(
select txn_id,member, sum(qty * price) as total_revenue
from sales
group by member, txn_id
)
select member,avg(total_revenue) as avg_revenue
from cte
group by member

-------------------------------------------------
--Q8. What are the top 3 products by total revenue before discount?

select p.product_name,sum(s.qty * s.price) as total_revenue 
from sales s 
join product_details p
on p.product_id = s.prod_id
group by p.product_name
order by total_revenue desc
limit 3

------------------------------------------------
--Q9. What are the total quantity, revenue and discount for each segment?

select p.segment_name,sum(s.qty) as total_quentity, sum(s.qty * s.price) as total_revenue ,
sum(s.qty * s.price * s.discount)/100 as total_discount
from sales s 
join product_details p
on p.product_id = s.prod_id
group by p.segment_name

------------------------------------------------------
--Q10. What is the top selling product for each segment?

select p.segment_name, p.product_name ,sum(s.qty) as total_quentity
from sales s 
join product_details p
on p.product_id = s.prod_id
group by p.segment_name,p.product_name
order by total_quentity desc
limit 5

-------------------------------------------------------------
--Q11. What are the total quantity, revenue and discount for each category?

select p.category_name,sum(s.qty) as total_quentity, sum(s.qty * s.price) as total_revenue ,
sum(s.qty * s.price * s.discount)/100 as total_discount
from sales s 
join product_details p
on p.product_id = s.prod_id
group by p.category_name

--------------------------------------------------------------------
--Q12. What is the top selling product for each category?

select p.category_name, p.product_name ,sum(s.qty) as total_quentity
from sales s 
join product_details p
on p.product_id = s.prod_id
group by p.category_name,p.product_name
order by total_quentity desc
limit 5

